INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24001, 1, 0.0, 1, "あたしだって\nやるときはやるよ！", 10040, 0, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24002, 1, 0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 1, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24003, 1, 0.0, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 2, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24004, 2, 0.0, 2, "やったね！\nこれでようやく\nサボれるよ…", 10040, 3, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24005, 1, 0.0, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 4, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24006, 2, 0.0, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 5, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24007, 2, 0.0, 2, "あたしも意外と\nやるもんでしょ？", 10040, 6, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24008, 4, 0.0, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 7, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24009, 4, 0.0, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 8, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24010, 4, 0.0, 4, "まじめに\nやったんだけどな…\n悔しいな～", 10040, 9, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24011, 4, 0.0, 4, "やられた…\nねずみって意外と\nてごわいね", 10040, 10, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24012, 4, 0.0, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 11, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 0.0, 0.0, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (24013, 1, 0.0, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 12, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24, 102601, 1.81, 0.0, "リン");
